const CustomMap = (props) => {

  function getLatAndLng() {
    const { city, district, province } = props.rent;

    if (city) {
      const city_Arr = location.find(_city => _city.name === city);
      if (city_Arr.districts) {
        const district_Arr = city_Arr.districts.find(_district => _district.name === district);
        if (district_Arr.sub) {
          const province_Arr = district_Arr.sub.find(_province => _province.name === province);
          return { lat: province_Arr.latitude, lng: province_Arr.longitude };
        }
        else {
          return { lat: district_Arr.latitude, lng: district_Arr.longitude };
        }
      }
      else {
        return { lat: city_Arr.latitude, lng: city_Arr.longitude };
      }
    }
    else {
      return { lat: 50, lng: 50 };
    }

  }

  const mapProps = {
    point: getLatAndLng(),
    zoom: 13
  }

  const position = [mapProps.point.lat, mapProps.point.lng];

  return (
    <Map
      center={position}
      zoom={mapProps.zoom}
      zoomControl={false}

      doubleClickZoom={false}
      closePopupOnClick={false}
      dragging={false}
      zoomSnap={false}
      zoomDelta={false}
      trackResize={false}
      touchZoom={false}
      scrollWheelZoom={false}
    >
      <TileLayer
        // attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        url='https://{s}.tile.osm.org/{z}/{x}/{y}.png'
      />

      <Circle
        center={position}
        color='red'
        fillColor='#f03'
        fillOpacity={0.4}
        radius={1000}>
        {/* <Popup>
          {props.rent.city}
      </Popup> */}
      </Circle>
      {/* <CircleMarker center={position} color="red" radius={20}>
        <Popup>Popup in CircleMarker</Popup>
      </CircleMarker> */}
      {/* <Marker position={position} icon={myIcon} ></Marker> */}
      {/* <ZoomControl position='topright' /> */}
    </Map>
  )
}

CustomMap.prototype = {
  rent: PropTypes.object.isRequired
}

export default CustomMap;

